      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT ( + - col2 ) * + col1 + + col2 + - col2 * 33 * col0 + + + col0 IN ( + + 94 * + + 75, 15 );
  - name: tab1

outputs:
